import React, { Component } from "react";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="lander">
          <h1>Love On Rails</h1>
          <p>Hop on the soul train!</p>
        </div>
      </div>
    );
  }
}
